import {
	USERS_KEY
} from '../actions/keys';
const initialState = {
    contacts: {
    	[USERS_KEY]: {},
		newContact: {
				name: '',
				surname: '',
				email: '',
				address: '',
				phone: ''
			},
	},
	ui: {
			isContactFormHidden: true
		}
}

export default initialState;
